import AppRoutes from "./routes";

import UploadWidget from "./components/UploadWidget";


function App() {
  return (
    <Layout>
      <AppRoutes />
      <div className="container">
        <UploadWidget></UploadWidget>
      </div>
    </Layout>

  );
}

export default App;
